const tobogganTrajectory = (arr) => {
    const lineLength = arr[0].length;
    let results = 1;
    let traversals = [
        [1, 1],
        [3, 1],
        [5, 1],
        [7, 1],
        [1, 2]
    ];
    for (let i = 0; i < traversals.length; i++) {

        let right = traversals[i][0];
        let down = traversals[i][1];
        let treesHit = 0;
        for (let j = down; j < arr.length; j += down) {
            const position = ((j * right) / down) % lineLength;

            if (arr[j][position] === '#') {
                treesHit++;
            }
        }
        results *= treesHit;
    }

    return results;
};

